import React from "react";
import { Field, ErrorMessage } from "formik";
import Password from "./Passwordd";

function TextInput(props) {
  return (
    <Field
      name="password"
      as={Password}
      label="Password"
      fullWidth
      required
      helperText={<ErrorMessage name="password"></ErrorMessage>}
    ></Field>
  );
}

export default TextInput;
